INSERT INTO field_data_body VALUES ('node', 'article', 0, 1, 1, 'und', 0, 'En esta entrada del blog se documenta el anlisis realizado a una variante de la familia de malware Dalixy, tambin conocida como LdPinch, Dalia o Trodal. Dalixy es un programa malicioso que tiene caractersticas tanto de gusano (envo por correo electrnico) como de bot (comunicacin por medio de un canal de IRC).', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 2, 2, 'und', 0, 'El siguiente anlisis realizado al troyano "FIFA_BOLETO.exe", muestra la forma en la que opera la propagacin masiva de malware aprovechando un evento internacional como lo es el "mundial de futbol 2014". El binario fue creado para descargar otro cdigo malicioso, lo cual se conoce como "downloader".', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 4, 4, 'und', 0, 'In this blog entry, the malware analysis team of UNAM-CERT will show a way to analyze a DLL file using already known tools and some specially developed by us.
ADLL or Dynamic Link Library is a file that contains blocks of code (functions or methods) that are run by request of a program. Is at this moment when it is loaded in memory.
Different programscan simultaneously use a DLL due to its modular scheme. Therefore, uninstalling a program could affect other applications that make use of shared libraries.
', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 3, 3, 'und', 0, 'Durante los das festivos se incrementa la actividad maliciosa debido a que los atacantes suelen ser ms exitosos al aprovecharse de los usuarios mediante engaos. El da de San Valentn es uno de los mejores ejemplos de esto; por lo que el equipo de anlisis de malware del UNAM-CERT decidi publicar un reporte acerca de una muestra que, aunque no es reciente, ejemplifica muy bien los peligros de caer en fraudes de los creadores de cdigos maliciosos.

El gusano Yaha, que tambin es conocido como Lentin, fue particularmente infeccioso para usuarios de Windows durante los aos 2002 y 2003. Se propagaba va correo electrnico con el asunto Melt the Heart of your Valentine with this beautiful Screen saver (que puede traducirse como Derrite el corazn de tu enamorado con este hermoso protector de pantalla) y contena el archivo adjunto Valentin.scr.', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 5, 5, 'und', 0, 'El gusano Agent.btz, dirigido a la milicia estadounidense, entre muchos otros en 2008, fue probablemente la inspiracin de las nuevas generaciones de armas para el espionaje ciberntico, incluyendo el recientemente documentado Turla (Snake o Uroburos), segn Kaspersky Lab.
Lo que la firma sugiere es que el nmero de otras misteriosas armas cibernticas, incluyendo Red October en  2013 y Flame/Gauss de 2012, parecen tener relacin con Agent.btz de alguna manera.', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 6, 6, 'und', 0, 'Ryan Gallagher y Glenn Greenwald de The Intercept reportaron archivos clasificados que muestran "nuevos detalles respecto a la inovadora forma de vigilar que la NSA ha desarrollado para infectar a millones de computadoras alrededor del mundo a travs de malware". Las inyecciones seran parte de una expansin que eliminara las intervenciones manuales en los procesos de intrusin no autorizada, dejando la intrusin masiva a cargo de sistemas automatizados. La infraestructura de apoyo del nuevo programa correr fuera de las instalaciones de la NSA en FortMade, Maryland; en la Unin Britnica y en Japn.
"Cuando se haya desplegado el malware en los sistemas, potencialmente se crearn nuevas vulnerabilidades en el mismo, hacindolos ms propensos a ataques de terceros", mencion Mikko Hipponen, jefe de investigacin de la empresa de seguridad Finlandesa, F-Secure. "Suena como a infeccin y vigilancia al por mayor".
', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 7, 7, 'und', 0, 'Bajo ciertas condiciones, cualquier sitio de WordPress puede utilizarse para lanzar un ataque de denegacin de servicio (DoS, por las siglas en ingls de Denial of Service). El propietario de un popular sitio web descubri esto cuando se convirti en vctima de un ataque de denegacin de servicio distribuido (DDoS), llevado a cabo a travs de ms de 162 mil sitios de WordPress legtimos. El ataque inhabilit el sitio web en lo que se conoce como un ataque de inundacin distribuido basado en HTTP (capa 7). La vctima es un cliente de Sucuri y no puede ser nombrado. ', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 8, 8, 'und', 0, 'La cuenta de Twitter del cantante de pop Justin Bieber fue hackeada durante 15 minutos aproximadamente, antes de que fuera corregida. La siguen 50.2 millones de personas y es la segunda con la mayor audiencia. Los spammers tuitearon en idioma indonesio desde la cuenta comprometida, incluyeron enlaces a una aplicacin maliciosa llamada "ShootingStarPro". En los mensajes se poda leer "Justin Bieber Cemberut?, que en espaol significa "Justin Bieber resentido". Todo parece indicar que la cuenta de Twitter de Justin fue secuestrada por cibercriminales indonesios mediante una aplicacin maliciosa. A travs de ella se tuitearon enlaces al sitio malicioso rumahfollowers[dot]tk, el cual alojaba la aplicacin ShootingStarPro, de esta manera lograron afectar a millones de seguidores con una sola accin.', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 9, 9, 'und', 0, 'Con una fotografa de la Nebuolsa Cabeza de Mono, situada a 6.400 aos luz de distancia en la constelacin de Orin, el telescopio espacial Hubble celebr sus 24 aos de estar en el Espacio. El Hubble de la NASA, tambin conocido como el ojo en el cielo, fue lanzado al espacio hace ms de 20 aos, y hasta el da de hoy sigue proporcionando extraordinarias imgenes e informacin til para conocer el universo.
Este gran telescopio espacial fue desarrollado por la Agencia Espacial de los Estados Unidos (NASA) y la Agencia Espacial Europea (ESA).', '', 'filtered_html');
INSERT INTO field_data_body VALUES ('node', 'article', 0, 10, 10, 'und', 0, 'Los responsables del prestigioso Instituto japons de investigacin Riken pidieron disculpas por las anomalas en un controvertido estudio sobre clulas madre cuyos resultados han sido cuestionados por parte de la comunidad cientfica. La institucin, financiada por el Estado nipn, convoc una rueda de prensa para hacer pblico el desarrollo de su investigacin, que permanece abierta, en torno a las irregularidades detectadas.

El estudio, publicado en enero por la revista Nature, demostraba un mtodo muy sencillo para reprogramar clulas adultas (sumergindolas en un cido o aplicando presin sobre sus membranas) y obtener as clulas madre, con capacidad para transformarse en cualquier tejido.', '', 'filtered_html');


